import React from "react";
import logo from "./../../images/logo.png";
import "./messenger.css";

function Messenger() {
  return (
    <div className="messenger">
      <div className="dashboard">
        <div className="header">
          <img className="header--logo" alt="logo" src={logo}></img>
          <div className="header--title">SCRIBBLE CHAT</div>
        </div>
        <div className="search--box">
          <input className="search" placeholder="Search"></input>
        </div>
        <div className="chat--profiles">
          <UserProfile />
        </div>
        <div className="user--profile"></div>
      </div>
      <div className="message"></div>
    </div>
  );
}

const UserProfile = () => {
  return (
    <div className="profile">
      <div className="user--logo">A</div>
      <div className="user--information">
        <div className="limitlength user--name">
          Avishka Junghareefrdgserdgfdjgn fdljkn
        </div>
        <div className="limitlength user--email">
          avishkajunghare06@gmail.com
        </div>
      </div>
    </div>
  );
};

export default Messenger;
